import { Routes, Route } from "react-router-dom";
import './style/App.css';
import Mainmenupage from "./components/Mainmenupage.js";
import Pagefancontent from "./components/pagefancontent.js";
import Pagevideogames from "./components/Pagevideogames.js";
import Pagecharacters from "./components/Pagecharacters";

const  App= ()  => {
  return (
  <div className="App">
    <Routes>
      <Route path="/" element={<Mainmenupage />} />
      <Route path="/characters" element={<Pagecharacters />} />
      <Route path="/fancontent" element={<Pagefancontent />} />
      <Route path="/videogames" element={<Pagevideogames />} />
    </Routes>
  </div>
  );
}
export default App;
